import React from 'react';
import {DeafaultSection} from './styles';

type Props = {
  children: React.ReactNode;
}
function Section({ children }: Props) {
    return (
      <DeafaultSection>
        {children}
      </DeafaultSection>
    );
};
  
export default Section;
